import React from "react";
import { useState, useEffect } from "react";

const Fetch = () => {
  const [students, setStudents] = useState([]);
  fetch("https://jsonplaceholder.typicode.com/users")
    .then((res) => res.json())
    .then((res) => {
      setStudents(res)
    });

  return (
    <div>
      <h1>Students List</h1>
      <div>
        {students.map((value) => (
          <h1>Name : {value.name}</h1>
        ))}
      </div>
    </div>
  );
};

export default Fetch;
